import React from "react";
import { Container, Row, Col, Form } from "react-bootstrap";
import { FaUserCircle } from "react-icons/fa";

export default function NavbarComponent() {
  return (
    <Container>
      <Row>
        <Col xs={6} md={4}>
          Cinema App
        </Col>
        <Col xs={6} md={4}>
          <input type="text" placeholder="search" />
          <Form
            inline
            onSubmit={onSubmit}
            onChange={onChange}
            value={text}
            autoComplete="off"
            className=" pb-lg-0"
          >
            {/* <Form inline > */}
            <div className="search d-block d-md-flex ">
              <div className="box-search">
                <div class="container-2">
                  <BiSearch className="icon float-right" />
                  <input
                    type="search"
                    id="search"
                    className="mb-5"

                    // onSubmit={onSubmit}
                    // onChange={onChange}
                    // value={text}
                  />
                </div>
              </div>
            </div>
          </Form>
        </Col>
        <Col xs={6} md={4}>
          <div>
            <FaUserCircle />
          </div>
        </Col>
      </Row>
    </Container>
  );
}
